import Register from "./components/pages/auth/Register";
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <h1>Hello World</h1>
      <Routes>
        <Route path="/register" element={<Register/>}/>
      </Routes>
    </div>
  );
}

export default App;
